import React from "react";
import { BrowserRouter, Route, Router } from "react-router-dom";
import Layout from "./Layout";


export default function Test16(){

    return(
        <>
        <BrowserRouter>
        <Router>
            <Route path="/"  element={<Layout/>}/>
        </Router>
        </BrowserRouter>
        </>
    )
}
